	('9da0abe0-e5eb-4724-8f27-000d6fdf6691', 'e103178f-4e2f-4018-aa64-97e622ab88b7', 'assistant', 'An agent in this app is typically configured to automate specific tasks, interact with users, answer questions, or manage certain aspects of a website or business process.

**Main purposes of an agent:**
- Automate customer support or FAQs
- Gather user feedback or handle inquiries
- Guide users through your website or app
- Execute specific tasks based on user commands or workflows

**Getting started with configuring an agent:**
1. **Name and Domain**: Choose a name for your agent and specify the website domain where it will operate.
2. **Model Selection**: Select the AI model the agent will use for understanding and generating responses.
3. **Prompts/Instructions**: Set up prompts, instructions, or rules that guide the agent’s behavior and tone.
4. **Optional Settings**: Configure any additional options, such as integration points, triggers, or advanced settings.

Would you like step-by-step guidance on creating your first agent? If yes, I can walk you through the configuration process!', '2025-09-16 19:27:44.506825+00', 2),
